import styled from "styled-components";

export const Cont = styled.section`
    width: 100%; height: 100vh;
    background-color: rgba(0,0,0,0.5);
    position:absolute;
    left: 0; top: 0;
`
export const Nav = styled.nav`
    width:40%; height: 20%;
    background-color: white;
    margin-top: 8%;
    position: relative;
    right: 0;
`
